    if (f.dimension < 1) { appStore.setFuntionDimension(id, 1) }

    // console.log("function ", f.id, " dimensions ", f.dimension)

    console.log("for")
    for (let i = 0; i < f.dimension; i++) {
        <div>
            {console.log("inside for")}
